{"output":"'use client';

import { format, Locale } from 'date-fns';
import { enUS, th } from 'date-fns/locale';
import { Calendar as CalendarIcon } from 'lucide-react';
import { useLocale, useTranslations } from 'next-intl';

import { Button } from '@/components/ui/button';
import { Calendar } from '@/components/ui/calendar';
import {
  Popover,
  PopoverContent,
  PopoverTrigger,
} from '@/components/ui/popover';
import FadeInAnimation from '../amimation/FadeIn';

interface DatePickerWithLabelProps {
  id: string;
  value?: Date;
  onSelect: (date: Date | undefined) => void;
}

export function DatePickerWithLabel({
  id,
  value,
  onSelect,
}: DatePickerWithLabelProps) {
  const locale = useLocale();
  const t = useTranslations('DatePicker');
  const locales: Record<string, Locale> = {
    en: enUS,
    th,
  };
  return (
    <Popover>
      <PopoverTrigger asChild>
        <Button
          variant="ghost"
          corner="square"
          id={id}
          className="border-input w- flex h-11 justify-between border p-0 font-normal hover:scale-100"
        >
          {value ? (
            format(value, 'dd MMMM yyyy', { locale: locales[locale] })
          ) : (
            <span>{t('pickDate')}</span>
          )}
          <CalendarIcon size={16} />
        </Button>
      </PopoverTrigger>
      <PopoverContent asChild sideOffset={8}>
        <FadeInAnimation>
          <Calendar
            mode="single"
            selected={value}
            onSelect={onSelect}
            disabled={(date) =>
              date > new Date() || date < new Date('1900-01-01')
            }
            captionLayout="label"
            locale={locales[locale]}
            className="transition-all"
          />
        </FadeInAnimation>
      </PopoverContent>
    </Popover>
  );
}
