interface FadeInAnimationProps {
  children: React.ReactNode;
}

const FadeInAnimation = ({ children }: FadeInAnimationProps) => {
  return (
    <motion.div
      initial={{ opacity: 0, y: -10 }} // fade + drop from above
      animate={{ opacity: 1, y: 0 }}
      exit={{ opacity: 0, y: -10 }} // fadeout back to above
      transition={{ duration: 0.2, ease: 'easeInOut' }}
      className="bg-popover w-auto rounded-md p-2 shadow-xl"
    >
      {children}
    </motion.div>
  );
};

