**What’s happening**  
Keeping `asChild` means Radix forwards its ref + handlers + className onto `FadeInAnimation`. Right now `FadeInAnimation` (`techcare-user-nextjs/src/components/common/amimation/FadeIn.tsx:7`) ignores them, so the popover can’t capture pointer events and closes immediately; dropping `asChild` fixes the interactions but reintroduces Radix’s own `w-72` wrapper, which clips your animation.

**Fix**  
Keep `asChild`, but make `FadeInAnimation` pass the forwarded ref/props down to the `motion.div`. Example update:

```tsx
// techcare-user-nextjs/src/components/common/amimation/FadeIn.tsx
import React from 'react';
import { motion } from 'framer-motion';
import { cn } from '@/lib/utils';

interface FadeInAnimationProps
  extends React.ComponentPropsWithoutRef<typeof motion.div> {
  children: React.ReactNode;
}

const FadeInAnimation = React.forwardRef<HTMLDivElement, FadeInAnimationProps>(
  ({ children, className, ...rest }, ref) => (
    <motion.div
      ref={ref}
      initial={{ opacity: 0, y: -10 }}
      animate={{ opacity: 1, y: 0 }}
      exit={{ opacity: 0, y: -10 }}
      transition={{ duration: 0.2, ease: 'easeInOut' }}
      className={cn('bg-popover w-auto rounded-md p-2 shadow-xl', className)}
      {...rest}
    >
      {children}
    </motion.div>
  ),
);

FadeInAnimation.displayName = 'FadeInAnimation';

export default FadeInAnimation;
```

Now `PopoverContent` keeps its animation wrapper, Radix’s handlers stay intact, and the calendar remains clickable without the layout overflow. After the change you can reopen the picker to confirm the navigation works and the panel sizes naturally.

